import React from 'react';
import { ThemeProvider, createTheme, CssBaseline } from '@mui/material';
import TechnologyValidator from './components/TechnologyValidator';

// Crear un tema personalizado con colores claros
const theme = createTheme({
  palette: {
    primary: {
      main: '#3f51b5',
    },
    secondary: {
      main: '#f50057',
    },
    background: {
      default: '#f5f5f5',
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
    h4: {
      fontWeight: 600,
    },
  },
  shape: {
    borderRadius: 8,
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          textTransform: 'none',
        },
      },
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div className="App">
        <TechnologyValidator />
      </div>
    </ThemeProvider>
  );
}

export default App;
